import React, { Component } from "react";
import {
  GoogleMap,
  LoadScript,
  DirectionsService,
} from "@react-google-maps/api";
import "./Map.scss";

const containerStyle = {
  width: "100%",
  height: "350px",
};

const center = {
  lat: 43.64563,
  lng: -79.39545,
};

class Map extends Component {
  constructor(props) {
    super(props);

    this.state = {
      response: null,
      travelMode: "DRIVING",
      origin: "",
      destination: "",
    };

    this.directionsCallback = this.directionsCallback.bind(this);
    this.checkDriving = this.checkDriving.bind(this);
    this.checkBicycling = this.checkBicycling.bind(this);
    this.checkTransit = this.checkTransit.bind(this);
    this.checkWalking = this.checkWalking.bind(this);
    this.getOrigin = this.getOrigin.bind(this);
    this.getDestination = this.getDestination.bind(this);
    this.onClick = this.onClick.bind(this);
    this.onMapClick = this.onMapClick.bind(this);
  }

  directionsCallback(response) {
    console.log(response);
    if (response !== null) {
      if (response.status === "OK") {
        this.setState(() => ({
          response,
        }));
      } else {
        console.log("response: ", response);
      }
    }
  }

  render() {
    return (
      <div className="Map">
        <LoadScript googleMapsApiKey="AIzaSyDZ4HxogFXeESTTN2JXpPpjCRozf7vEfIk">
          <GoogleMap
            mapContainerStyle={containerStyle}
            center={center}
            zoom={15}
          >
            {/* Child components, such as markers, info windows, etc. */}
            <DirectionsService
              // required
              options={{
                destination: this.state.destination,
                origin: this.state.origin,
                travelMode: this.state.travelMode,
              }}
              // required
              callback={this.directionsCallback}
              // optional
              onLoad={(directionsService) => {
                console.log(
                  "DirectionsService onLoad directionsService: ",
                  directionsService
                );
              }}
              // optional
              onUnmount={(directionsService) => {
                console.log(
                  "DirectionsService onUnmount directionsService: ",
                  directionsService
                );
              }}
            />
            <></>
          </GoogleMap>
        </LoadScript>
      </div>
    );
  }
}

export default Map;
